import styled from "@emotion/styled";
import { useState } from "react";
import { CardContentT } from "../typesTS/CardContent";
import { PupilStatT } from "../typesTS/PupilStatT";

// import styled from "@emotion/styled/macro";

export default function BigCard({
  pupilStatElem,
}: {
  pupilStatElem: PupilStatT;
}) {
  // styles

  const Container = styled.div`
    display: flex;
    flex-direction: column;
    max-width: 279px;
    margin-top: 50px;
    height: 230px;
    margin-left: 150px;
    background: #fff;
  `;
  const BasicInfoContainer = styled.div`
    display: grid;
    width: 278px;
    grid-template-rows: 45px 40px;
    grid-template-columns: 50px 194px;
    background-color: #fff;
  `;
  const DetailedInfoContainer = styled.div`
    margin-top: 14px;
    display: flex;
    justify-content: space-between;
    height: 103px;
    flex-direction: column;
    background-color: #fff;
  `;
  const CardPic = styled.img`
    grid-column-start: 1;
    grid-column-end: 2;
    grid-row-start: 1;
    grid-row-end: 3;
    margin-left: 20px;
    margin-top: 34px;
  `;
  const Label = styled.span`
    font-family: "Jost", sans-serif;
    font-size: 13px;
    color: rgba(0, 0, 0, 0.5);
    grid-column-start: 2;
    grid-column-end: 3;
    grid-row-start: 1;
    grid-row-end: 2;
    margin-top: 25px;
    margin-left: 15px;
  `;
  const Text = styled.div`
    font-family: "Jost", sans-serif;
    font-size: 26px;
    margin-left: 14px;
    margin-top: 1px;
    grid-column-start: 2;
    grid-column-end: 3;
    grid-row-start: 2;
    grid-row-end: 3;
  `;
  const AdditionText = styled.span`
    font-family: "Jost", sans-serif;
    font-size: 18px;
  `;
  const InfoNode = styled.div`
    font-family: "Jost", sans-serif;
    font-size: 13px;
    color: rgba(0, 0, 0, 0.5);
    display: flex;
    padding-left: 19px;
    padding-right: 0px;
  `;
  const NodeLabel = styled.div``;
  const NodeQuantity = styled.div`
    margin-left: auto;
    color: black;
  `;
  const Dots = styled.div`
    background: yellow;
    width: 50px;
    overflow: hidden;
    height: 2px;
  `;
  const LabelText = styled.span``;
  // functionality
  return (
    <Container>
      <BasicInfoContainer>
        <CardPic src={pupilStatElem.picAdress}></CardPic>
        <Label>Количество учеников</Label>
        <Text>{pupilStatElem.quantity}</Text>
      </BasicInfoContainer>
      <DetailedInfoContainer>
        <InfoNode>
          <NodeLabel>За последнюю неделю</NodeLabel>
          <NodeQuantity>{pupilStatElem.lastWeek}</NodeQuantity>
        </InfoNode>
        <InfoNode>
          <NodeLabel>Без абонемента</NodeLabel>
          <NodeQuantity>{pupilStatElem.withoutAbo}</NodeQuantity>
        </InfoNode>
        <InfoNode>
          <NodeLabel>Неактивные</NodeLabel>
          <NodeQuantity>{pupilStatElem.withoutAbo}</NodeQuantity>
        </InfoNode>
        <InfoNode>
          <NodeLabel>
            <LabelText>Добавлено за день</LabelText>
            <Dots>............................................</Dots>
          </NodeLabel>
          <NodeQuantity>{pupilStatElem.withoutAbo}</NodeQuantity>
        </InfoNode>
      </DetailedInfoContainer>
    </Container>
  );
}
